phone: 408-924-2460email:jessica.trask@sjsu.edudr. jessica trask is the director of research compliance. prior to joining the san jos state university division of research and innovation, she was with the research compliance and integrity unit of the university of california, davis, first as a research investigations and compliance professional and later as the export control compliance specialist.dr. trask holds a bachelors degree in anthropology and biology from indiana university and a ph.d. in anthropology from columbia university. in 2006, she joined the university of california, davis as an nih-funded postdoctoral researcher, focusing on genetic variation and disease susceptibility in wild and captive primate populations.in this role, dr. trask manages university compliance with federal regulations, state law, and related csu, sjsu, and research sponsor policies. she guides faculty, staff, and students in conducting research that is legal and ethical and oversees all areas of research compliance, including financial conflicts of interest in research, investigating allegations of research misconduct, human and animal subjects protection, export control, responsible conduct of research (rcr) training, and other related compliance areas. she works closely with other compliance units on campus and the sjsu research foundation to adapt to the rapidly evolving regulatory landscape, promote organizational values, and support faculty and student success in all areas of research, scholarship, and creative activities.